    @Override
    public boolean equals(Object o) {
        if (this == o) return true;
        if (o == null || getClass() != o.getClass()) return false;
        Project that = (Project) o;
        return
            Objects.equals(this.archived, that.archived) &&
            Objects.equals(this.archivedBy, that.archivedBy) &&
            Objects.equals(this.archivedDate, that.archivedDate) &&
            Objects.equals(this.assigneeType, that.assigneeType) &&
            Objects.equals(this.avatarUrls, that.avatarUrls) &&
            Objects.equals(this.components, that.components) &&
            Objects.equals(this.deleted, that.deleted) &&
            Objects.equals(this.deletedBy, that.deletedBy) &&
            Objects.equals(this.deletedDate, that.deletedDate) &&
            Objects.equals(this.description, that.description) &&
            Objects.equals(this.email, that.email) &&
            Objects.equals(this.expand, that.expand) &&
            Objects.equals(this.favourite, that.favourite) &&
            Objects.equals(this.id, that.id) &&
            Objects.equals(this.insight, that.insight) &&
            Objects.equals(this.isPrivate, that.isPrivate) &&
            Objects.equals(this.issueTypeHierarchy, that.issueTypeHierarchy) &&
            Objects.equals(this.issueTypes, that.issueTypes) &&
            Objects.equals(this.key, that.key) &&
            Objects.equals(this.landingPageInfo, that.landingPageInfo) &&
            Objects.equals(this.lead, that.lead) &&
            Objects.equals(this.name, that.name) &&
            Objects.equals(this.permissions, that.permissions) &&
            Objects.equals(this.projectCategory, that.projectCategory) &&
            Objects.equals(this.projectTypeKey, that.projectTypeKey) &&
            Objects.equals(this.properties, that.properties) &&
            Objects.equals(this.retentionTillDate, that.retentionTillDate) &&
            Objects.equals(this.roles, that.roles) &&
            Objects.equals(this.self, that.self) &&
            Objects.equals(this.simplified, that.simplified) &&
            Objects.equals(this.style, that.style) &&
            Objects.equals(this.url, that.url) &&
            Objects.equals(this.uuid, that.uuid) &&
            Objects.equals(this.versions, that.versions);
    }

